INSERT INTO `department` (`id`, `hospital_id`, `name`, `info`, `tel`) VALUES
(1, 1, '眼科', '眼科的全称是“眼病专科”。眼科是研究发生在视觉系统，包括眼球及与其相关联的组织有关疾病的学科。', '010-88888101'),
(2, 1, '耳鼻喉科', '“耳鼻咽喉科”是诊断治疗耳、鼻、咽喉、及其相关头颈区域的外科学科。', '010-88888201'),
(3, 1, '外科', '外科是研究外科疾病的发生，发展规律及其临床表现，诊断，预防和治疗的科学，是以手术切除、修补为主要治病手段的专业科室。', '010-88888301'),
(4, 1, '骨科', '骨科是各大医院最常见的科室之一，主要研究骨骼肌肉系统的解剖、生理与病理，运用药物、手术及物理方法保持和发展这一系统的正常形态与功能。', '010-88888401'),
(5, 1, '内科', '内科学是临床医学的一个专科，几乎是所有其他临床医学的基础，亦有医学之母之称。内科学的内容包含了疾病的定义、病因、致病机转、流行病学、自然史、症状、征候、实验诊断、影像检查、鉴别诊断、诊断、治疗、预后。', '010-88888501'),
(6, 1, '妇产科', '妇产科是临床医学四大主要学科之一，主要研究女性生殖器官疾病的病因、病理、诊断及防治，妊娠、分娩的生理和病理变化，高危妊娠及难产的预防和诊治，女性生殖内分分泌，计划生育及妇女保健等。', '010-88888601'),
(7, 1, '儿科', '儿科是全面研究小儿时期身心发育、保健以及疾病防治的综合医学科学。', '010-88888701'),
(8, 1, '放射科', '放射科是医院重要的辅助检查科室，在现代医院建设中，放射科是一个集检查、诊断、治疗一体科室，临床各科许多疾病都须通过放射科设备检查达到明确诊断和辅助诊断。', '010-88888801'),
(9, 1, '牙科', '牙科，医学学科分类之一，在大医院一般并入口腔科。牙科主要治疗牙齿、牙周相关的疾病。', '010-88888901'),
(10, 1, '皮肤科', '皮肤科是治疗皮肤疾病的医学分支。也指综合性医院当中诊疗皮肤疾病的科室。在广义上，皮肤科还包含对头发、指（趾）甲疾病的治疗。', '010-88888001'),
