(45, 5, '内科', '内科学是临床医学的一个专科，几乎是所有其他临床医学的基础，亦有医学之母之称。内科学的内容包含了疾病的定义、病因、致病机转、流行病学、自然史、症状、征候、实验诊断、影像检查、鉴别诊断、诊断、治疗、预后。', '010-88888505'),
(46, 5, '妇产科', '妇产科是临床医学四大主要学科之一，主要研究女性生殖器官疾病的病因、病理、诊断及防治，妊娠、分娩的生理和病理变化，高危妊娠及难产的预防和诊治，女性生殖内分分泌，计划生育及妇女保健等。', '010-88888605'),
(47, 5, '儿科', '儿科是全面研究小儿时期身心发育、保健以及疾病防治的综合医学科学。', '010-88888705'),
(48, 5, '放射科', '放射科是医院重要的辅助检查科室，在现代医院建设中，放射科是一个集检查、诊断、治疗一体科室，临床各科许多疾病都须通过放射科设备检查达到明确诊断和辅助诊断。', '010-88888805'),
(49, 5, '牙科', '牙科，医学学科分类之一，在大医院一般并入口腔科。牙科主要治疗牙齿、牙周相关的疾病。', '010-88888905'),
