INSERT INTO `doctor` (`id`, `department_id`, `name`, `photo`, `info`, `title`, `price`) VALUES
(1, 1, '王托地', '1.jpg', '王托地,医学博士,理学副教授,药学副教授。中国人民解放军总医院301医院眼科特级专家。1979年东京大学获眼科硕士学位,1984年伦敦皇家医学院获眼科博士学位,1987年牛津大学获眼科Ph.D<br>从事眼科工作已经15年。有丰富的医学、药理学知识与经验。发表文章12余篇。现任《中国医科大学学报》主编,《中国实用医学杂志》编纂委员会主任。<br>', '特级专家', '4.43'),
(2, 1, '韩夸至', '2.jpg', '韩夸至,医学教授,理学副教授,药学硕士。中国人民解放军总医院301医院眼科医师。1960年东京大学获眼科硕士学位,1964年东京大学获眼科博士学位,1972年伦敦皇家医学院获眼科Ph.D<br>从事眼科工作已经19年。有丰富的医学、药理学知识与经验。发表文章26余篇。现任《中华临床营养杂志》指导委员会常委,《中国实用医学杂志》主编。<br>', '医师', '16.88'),
(3, 1, '孙扩', '3.jpg', '孙扩,医学硕士,理学副教授,药学教授。中国人民解放军总医院301医院眼科医师。1960年牛津大学获眼科硕士学位,1965年九州大学获眼科博士学位,1971年中国医科大学获眼科Ph.D<br>从事眼科工作已经19年。有丰富的医学、药理学知识与经验。发表文章11余篇。现任《中华临床营养杂志》指导委员会常委,《中国实用医学杂志》主编。<br>', '医师', '2.93'),
(4, 1, '郑巩压', '4.jpg', '郑巩压,医学博士,理学教授,药学教授。中国人民解放军总医院301医院眼科特级专家。1972年牛津大学获眼科硕士学位,1979年浙江大学获眼科博士学位,1984年中国医科大学获眼科Ph.D<br>从事眼科工作已经5年。有丰富的医学、药理学知识与经验。发表文章25余篇。现任《中国医科大学学报》协会成员,《中国实用医学杂志》编纂委员会主任。<br>', '特级专家', '5.04'),
(5, 1, '施芒至', '5.jpg', '施芒至,医学博士,理学副教授,药学硕士。中国人民解放军总医院301医院眼科海外专家。1972年九州大学获眼科硕士学位,1975年北京大学获眼科博士学位,1982年牛津大学获眼科Ph.D<br>从事眼科工作已经15年。有丰富的医学、药理学知识与经验。发表文章12余篇。现任《中华临床营养杂志》指导委员会常委,《中国医学年鉴》编纂委员会主任。<br>', '海外专家', '9.78'),
(6, 2, '魏页', '6.jpg', '魏页,医学教授,理学教授,药学硕士。中国人民解放军总医院301医院耳鼻喉科专家。1965年清华大学获耳鼻喉科硕士学位,1972年北京大学获耳鼻喉科博士学位,1975年中国医科大学获耳鼻喉科Ph.D<br>从事耳鼻喉科工作已经19年。有丰富的医学、药理学知识与经验。发表文章32余篇。现任《中华临床营养杂志》主编,《中国实用医学杂志》主编。<br>', '专家', '6.87'),
(7, 2, '周巩', '7.jpg', '周巩,医学博士,理学博士,药学教授。中国人民解放军总医院301医院耳鼻喉科海外专家。1971年九州大学获耳鼻喉科硕士学位,1975年伦敦皇家医学院获耳鼻喉科博士学位,1983年中国医科大学获耳鼻喉科Ph.D<br>从事耳鼻喉科工作已经19年。有丰富的医学、药理学知识与经验。发表文章27余篇。现任《中华临床营养杂志》编纂委员会主任,《中国医学年鉴》编纂委员会主任。<br>', '海外专家', '11.47'),
(8, 2, '李帆', '8.jpg', '李帆,医学副教授,理学教授,药学硕士。中国人民解放军总医院301医院耳鼻喉科海外专家。1967年北京大学获耳鼻喉科硕士学位,1971年东京大学获耳鼻喉科博士学位,1974年伦敦皇家医学院获耳鼻喉科Ph.D<br>从事耳鼻喉科工作已经14年。有丰富的医学、药理学知识与经验。发表文章23余篇。现任《自然杂志》主编,《中国医学年鉴》指导委员会常委。<br>', '海外专家', '7.69'),
(9, 2, '吕此', '9.jpg', '吕此,医学副教授,理学博士,药学副教授。中国人民解放军总医院301医院耳鼻喉科特级专家。1974年东京大学获耳鼻喉科硕士学位,1977年中国医科大学获耳鼻喉科博士学位,1983年九州大学获耳鼻喉科Ph.D<br>从事耳鼻喉科工作已经17年。有丰富的医学、药理学知识与经验。发表文章29余篇。现任《自然杂志》指导委员会常委,《中国医学年鉴》协会成员。<br>', '特级专家', '9.25'),
(10, 2, '魏吊地', '10.jpg', '魏吊地,医学教授,理学教授,药学硕士。中国人民解放军总医院301医院耳鼻喉科医师。1964年牛津大学获耳鼻喉科硕士学位,1970年北京大学获耳鼻喉科博士学位,1977年浙江大学获耳鼻喉科Ph.D<br>从事耳鼻喉科工作已经20年。有丰富的医学、药理学知识与经验。发表文章10余篇。现任《中华临床营养杂志》编纂委员会主任,《中国医学年鉴》编纂委员会主任。<br>', '医师', '8.12'),
(11, 3, '赵迈有', '11.jpg', '赵迈有,医学教授,理学副教授,药学硕士。中国人民解放军总医院301医院外科特级专家。1961年中国医科大学获外科硕士学位,1965年牛津大学获外科博士学位,1971年北京大学获外科Ph.D<br>从事外科工作已经20年。有丰富的医学、药理学知识与经验。发表文章25余篇。现任《中华临床营养杂志》编纂委员会主任,《中国实用医学杂志》主编。<br>', '特级专家', '18.34'),
