(1815, 363, '杨此', '1815.jpg', '杨此,医学硕士,理学博士,药学副教授。大连医科大学附属第二医院外科特级专家。1971年牛津大学获外科硕士学位,1975年伦敦皇家医学院获外科博士学位,1980年北京大学获外科Ph.D<br>从事外科工作已经6年。有丰富的医学、药理学知识与经验。发表文章34余篇。现任《中华临床营养杂志》指导委员会常委,《中国实用医学杂志》指导委员会常委。<br>', '特级专家', '4.30'),
