(2017, 404, '蒋有曲', '2017.jpg', '蒋有曲,医学副教授,理学硕士,药学副教授。中国人民解放军第461医院骨科医师。1977年牛津大学获骨科硕士学位,1981年中国医科大学获骨科博士学位,1987年东京大学获骨科Ph.D<br>从事骨科工作已经11年。有丰富的医学、药理学知识与经验。发表文章35余篇。现任《自然杂志》主编,《中国医学年鉴》主编。<br>', '医师', '6.76'),
