(2482, 497, '冯而', '2482.jpg', '冯而,医学博士,理学副教授,药学教授。吉林大学第四医院儿科特级专家。1965年伦敦皇家医学院获儿科硕士学位,1973年清华大学获儿科博士学位,1979年牛津大学获儿科Ph.D<br>从事儿科工作已经6年。有丰富的医学、药理学知识与经验。发表文章24余篇。现任《中国医科大学学报》主编,《中国医学年鉴》协会成员。<br>', '特级专家', '12.96'),
(2483, 497, '李吐岂', '2483.jpg', '李吐岂,医学硕士,理学博士,药学教授。吉林大学第四医院儿科专家。1960年牛津大学获儿科硕士学位,1968年东京大学获儿科博士学位,1972年清华大学获儿科Ph.D<br>从事儿科工作已经19年。有丰富的医学、药理学知识与经验。发表文章14余篇。现任《中国医科大学学报》主编,《中国实用医学杂志》主编。<br>', '专家', '1.98'),
(2484, 497, '吕死而', '2484.jpg', '吕死而,医学副教授,理学副教授,药学教授。吉林大学第四医院儿科专家。1969年九州大学获儿科硕士学位,1975年牛津大学获儿科博士学位,1983年牛津大学获儿科Ph.D<br>从事儿科工作已经6年。有丰富的医学、药理学知识与经验。发表文章21余篇。现任《中国医科大学学报》协会成员,《中国实用医学杂志》指导委员会常委。<br>', '专家', '8.67'),
