(2486, 498, '何夹', '2486.jpg', '何夹,医学硕士,理学教授,药学硕士。吉林大学第四医院放射科专家。1978年浙江大学获放射科硕士学位,1983年清华大学获放射科博士学位,1986年伦敦皇家医学院获放射科Ph.D<br>从事放射科工作已经11年。有丰富的医学、药理学知识与经验。发表文章28余篇。现任《中国医科大学学报》指导委员会常委,《中国实用医学杂志》编纂委员会主任。<br>', '专家', '16.58'),
