(2489, 498, '陈芝', '2489.jpg', '陈芝,医学副教授,理学教授,药学博士。吉林大学第四医院放射科海外专家。1966年浙江大学获放射科硕士学位,1971年九州大学获放射科博士学位,1974年清华大学获放射科Ph.D<br>从事放射科工作已经10年。有丰富的医学、药理学知识与经验。发表文章38余篇。现任《中华临床营养杂志》编纂委员会主任,《中国医学年鉴》协会成员。<br>', '海外专家', '9.29'),
