(2496, 500, '周协托', '2496.jpg', '周协托,医学教授,理学博士,药学博士。吉林大学第四医院皮肤科实习医生。1975年东京大学获皮肤科硕士学位,1979年清华大学获皮肤科博士学位,1983年牛津大学获皮肤科Ph.D<br>从事皮肤科工作已经12年。有丰富的医学、药理学知识与经验。发表文章36余篇。现任《自然杂志》指导委员会常委,《中国实用医学杂志》协会成员。<br>', '实习医生', '9.68'),
