(2498, 500, '赵托', '2498.jpg', '赵托,医学硕士,理学博士,药学博士。吉林大学第四医院皮肤科专家。1969年中国医科大学获皮肤科硕士学位,1973年浙江大学获皮肤科博士学位,1980年伦敦皇家医学院获皮肤科Ph.D<br>从事皮肤科工作已经20年。有丰富的医学、药理学知识与经验。发表文章14余篇。现任《中国医科大学学报》指导委员会常委,《中国医学年鉴》编纂委员会主任。<br>', '专家', '10.02'),
(2499, 500, '施岁', '2499.jpg', '施岁,医学硕士,理学硕士,药学硕士。吉林大学第四医院皮肤科实习医生。1972年伦敦皇家医学院获皮肤科硕士学位,1980年伦敦皇家医学院获皮肤科博士学位,1988年北京大学获皮肤科Ph.D<br>从事皮肤科工作已经18年。有丰富的医学、药理学知识与经验。发表文章22余篇。现任《中国医科大学学报》指导委员会常委,《中国实用医学杂志》主编。<br>', '实习医生', '2.31'),
(2500, 500, '蒋屿', '2500.jpg', '蒋屿,医学硕士,理学副教授,药学副教授。吉林大学第四医院皮肤科专家。1974年北京大学获皮肤科硕士学位,1982年北京大学获皮肤科博士学位,1985年北京大学获皮肤科Ph.D<br>从事皮肤科工作已经13年。有丰富的医学、药理学知识与经验。发表文章20余篇。现任《自然杂志》主编,《中国实用医学杂志》主编。<br>', '专家', '14.25');
INSERT INTO `hospital` (`id`, `rating_id`, `name`, `province`, `city`, `addr`, `tel`, `info`, `site`, `photo`) VALUES
(1, 8, '中国人民解放军总医院301医院', 'beijing', 'beijing', '北京市海淀区复兴路28号', '无', '<p>中国人民解放军总医院前身是中国协和医学院第二临床学院，1953年10月，总后方勤务部卫生部决定将“中国协和医学院第二临床学院”改为“军委直属机关医院”。1954年7月，总后方勤务部卫生部将“军委直属机关医院”改为“中国人民解放军第三0一医院”。1957年6月，国防部批示“中国人民解放军第三0一医院”番号撤销，改称为“中国人民解放军总医院”。军医进修学院是以解放军总医院为依托建设和发展起来的，始建于1958年11月，1962年停办。1979年6月，经中央军委批准恢复军医进修学院。1986年9月批准正式列入全军院校编制序号。2004年全军整编将三0四医院更名为三0四临床部，对外称解放军总医院第一附属医院，列入解放军总医院编制序列。 </p><p>解放军总医院是全军规模最大的综合性医院，集医疗、保健、教学、科研于一体，是国家重要保健基地之一，负责中央、军委和总部的医疗保健工作，承担全军各军区、军兵种疑难病的诊治，医院同时也收治来自全国的地方病人。</p><p>解放军总医院共展开床位4400余张，其中院本部3400余张，三0四临床部1000余张。医院设置165个临床、医技科室，163个护理单元，其中耳鼻咽喉-头颈外科、骨科、老年医学等6个国家级重点学科，1个国家重点培育学科，1个国家中西医结合老年病重点学科。另有科技部国家重点实验室1个，教育部重点实验室1个，全军医学重点实验室8个，北京市重点实验室6个，全军医学专科中心和研究所33个。</p><p>解放军总医院拥有先进的医疗、科研仪器，有正电子发射计算机断层成像仪（PET）、含3.0T在内的不同类型的核磁共振、含64排在内的螺旋CT、体外震波碎石机、含3100在内的数字减影血管造影机、彩色多普勒超声检查仪、治疗用直线加速器、X刀、电镜、ECT、激光聚焦显微镜、流式细胞仪、准分子激光仪等国际一流的医疗设备19702余件，价值百万以上医疗设备316余台，总价值26亿元人民币以上。雄厚的技术力量和先进的诊疗手段，促进了医院技术水平和医疗质量的不断提高，临床初诊与确诊符合率达99.36%，危重病抢救成功率达98.84%，患者满意率达97.38%。2008年门诊量408万人次，日均门诊量1.1万人次，收容病人14万人次，开展各种手术6.8万例。同时，医院每年开展250多项新业务、新技术，形成了明显的技术特色和优势，使许多疑难病得到有效诊治，许多复杂手术和重大抢救获得成功，一些诊断治疗技术达到国际先进水平。</p><p>解放军总医院医院技术力量雄厚，有专业技术人员4000多名，其中：高级专业技术职务人员859名，中国工程院院院士6名。享受政府特殊津贴281名,国家有突出贡献的中青年专家12名,获南丁格尔奖2人，现有国家级学会主任委员19人,候任主任委员7人，副主任委员9人,全军医学科委会各专业委员会主任委员19人，副主任委员36人。既有一批知识渊博、造诣精深、誉名中外的老专家，又有一批经验丰富、素质优良、具有突出专科特长的中年技术骨干，还有一大批基础理论扎实、勇于开拓进取、在专业技术领域脱颖而出的后起之秀。</p>', 'http://jiaowu.buaa.edu.cn', 'hospital/1.jpg'),
(2, 8, '北京同仁医院', 'beijing', 'beijing', '北京市东城区东交民巷1号', '010-58266699', '<p>首都医科大学附属北京同仁医院创建于1886年(清光绪12年)，是一所以眼科、耳鼻咽喉科和心血管疾病诊疗为重点的大型综合性医院。“同仁”字号和图徽是国家商标局认定的国内医疗服务业首家驰名商标。</p><p>医院兼有北京市眼科研究所 (世界卫生组织防盲合作中心、博士后流动站)和北京市耳鼻咽喉科研究所(博士后流动站)，附设北京同仁眼库(国际眼库协会成员)，设有北京市眼耳鼻咽喉科疾病研究中心和北京市糖尿病防治办公室。\r\n</p><p>全院现有职工2064人，副教授以上及相应职称者241人。开放病床860张，设有37个临床和基础科室，日门、急诊量3500—5000人次,年均住院病人约1.5万人次。</p><p>眼科和耳鼻咽喉科技术实力雄厚。眼科的眼底病、眼外伤、青光眼、角膜移植、眼部整形、激光诊疗；耳鼻咽喉科的人工耳蜗植入、全耳再造、听力康复、头颈肿瘤治疗、气管异物取出、鼻内窥镜技术、睡眠呼吸暂停综合症治疗等技术处于国内领先地位，某些领域达到国际先进水平。心血管疾病诊疗中心的建立使医院形成重点学科三足鼎立的局面。内科的糖尿病综合防治、异体干细胞移植治疗重症血液病以及外科的微创技术、胰岛移植等方面的临床水平亦引人瞩目。</p>', 'http://jiaowu.buaa.edu.cn', 'hospital/2.jpg'),
(3, 8, '北京天坛医院特需门诊', 'beijing', 'beijing', '北京市东城区天坛西里6号', '010-67096611', '<p>首都医科大学附属北京天坛医院始建于1956年8月23日，是一所以神经外科为先导，神经科学为特色，集医、教、研、防为一体的三级甲等综合性医院。是世界三大神经外科研究中心之一、亚洲的神经外科临床、科研、教学基地。医院总占地面积83900.56平方米，建筑面积 92898.56平方米，编制床位950张，临床、医技科室45个，全院职工总数2033人。年门急诊量约140余万人次，年住院病人约3万人次，年手术量2万余例。</p><p>北京市神经外科研究所、国家神经系统疾病临床医学研究中心、北京市伽玛刀治疗研究中心、北京市脑血管病抢救治疗中心、国家脑血管病创新药物临床评价技术平台、WHO在中国的神经科学培训合作中心、北京神外学院、首都医科大学第五临床医学院、全国脑血管病防治办公室、北京市脑血管病临床研究中心、北京市脑血管病防治指导办公室、中国卒中培训项目以及《中华神经外科杂志》、《中国卒中杂志》等一批机构设在医院。</p><p>神经外科、神经内科、神经放射科是国家重点学科。</p><p>神经外科、神经内科、护理专业是国家重点专科。</p>', 'http://jiaowu.buaa.edu.cn', 'hospital/3.jpg'),
(4, 8, '北京安贞医院小儿心脏中心', 'beijing', 'beijing', '安贞路2号', '010-64456534', '<p>北京安贞医院小儿心脏中心(北京市儿童心血管病中心)是国内综合医院最大的儿童心血管病中心，我国唯一实行小儿心血管疾病内、外科医疗管理一体化专科模式，具有集心脏外科、心脏内科、重症监护、功能检查为一体的优秀团队，在医疗、教育、科研三方面均达国内领先、国际先进水平。</p><p>小儿心脏中心主任刘迎龙教授，从事心血管外科医、教、研30余年，在心脏瓣膜及先心病外科有突出贡献，特别对婴幼儿重症复杂先心病提高手术疗效的临床与基础研究有非常深的造诣。刘迎龙教授曾负责国家“九五”、“十五”、“十一五”科技攻关、卫生部重大项目、首都发展基金等重大科研课题20余项，作为第一完成人获国家、省部级科技进步二、三等奖共5项。发表论文200余篇，培养博士近50名。</p><p>小儿心脏中心是北京安贞医院重点学科，具有小儿心血管诊疗的强劲实力，积累了丰富的管理及临床、科研经验，集聚了一大批高素质专业技术人才，目前承担国家、省部级和院校级科研课题10项，在读博士5名、硕士8名、博士后4名，拥有100张床位，内、外科年手术量达2000台以上。</p>', 'http://jiaowu.buaa.edu.cn', 'hospital/4.jpg'),
(5, 8, '北京中医药大学东直门医院国际部', 'beijing', 'beijing', '北京市东四北大街279号', '010-84012662', '<p>北京中医药大学东直门医院创建于1958年，是一所集医疗、教学、科研为一体的大型综合性中医院。是全国唯一一所进入国家“211工程”建设的高等中医药院校——北京中医药大学的第一临床医学院，并率先成为全国示范中医医院、三级甲等中医院和国家食品药品监督管理局认定的国家药物临床试验机构。是北京市医疗保险定点医疗机构，民政部“明天计划”脑瘫患儿手术康复和“点燃心希望”先心病治疗定点医院。2010年，医院被确立为“国家中医药发展综合改革试验区”建设示范基地和战略合作签约单位。2011年8月6日，原通州区中医医院与该院整合，并正式命名为北京中医药大学东直门医院东区。医院开创性地于1991年最早在欧洲建立了分院——德国魁茨汀医院，作为重要的中医药国际交流窗口，载入中德外交史册。</p><p>医院现为一院两区（本部和东区）。目前开放床位862张（本部574张；东区288张）。职工1515人（本部1069人；东区446人）。2011年东直门医院本部门诊量145.7万人次，收治住院病人14550人次。此外，2011年6月，医院先后在东城区台基厂3号及东城区东四北大街279号（即将开业）增设两个执业地点。</p><p>医院秉承“患者至上，服务第一”的办院宗旨，坚持“特色立院、人才强院、科技兴院、文化塑院”的战略方针，持牛耳而逐天下，为中医药事业的发展和人民的健康不断做出新的贡献！</p>', 'http://jiaowu.buaa.edu.cn', 'hospital/5.jpg'),
